   "source": [
    "From the above visualization, we can conclude that the steps taken hourly are highest from 11:00 to 14:00 hours and 17:00 to 19:00 hours in the day, which is most likely during lunch, while walking home, or going out after work.\n",
    "\n",
    "**7. Now let’s check the types of users based on the usage of smart devices**\n",
    "\n",
    "Considering the data is of only 31 days, we are dividing the categories into 3 types:\n",
    "\n",
    "* Highly Active User(more than 21 days)\n",
    "* Moderately Active User (11 to 20 days)\n",
    "* Least Active User (1 to 10 days)\n",
    "\n",
    "Now let’s create a data frame by grouping IDs, defining the days for each category as mentioned above"
   ]
