   "source": [
    "percent_usage <- device_usage %>% group_by(user_type)%>%\n",
    "    summarise(total = n()) %>%mutate(totals = sum(total))%>%group_by(user_type)%>%\n",
    "        drop_na()%>%summarise(total_percent = total / totals)%>%\n",
    "            mutate(labels = scales::percent(total_percent))\n",
    "\n",
    "\n",
    "percent_usage$user_type <- factor(percent_usage$user_type,\n",
    "                                  levels=c(\"highly active user\",\n",
    "                                           \"moderately active user\",\n",
    "                                           \"least active user\"))\n",
    "\n",
    "head(percent_usage)"
   ]
