    "### **SHARE**\n",
    "\n",
    "**KEY FINDINGS**\n",
    "\n",
    "Below are some key findings and observations based on the analysis and visualizations\n",
    "\n",
    "1. There is a positive correlation between time in bed and time of sleep. \n",
    "\n",
    "2. There is no correlation between time in bed and steps taken, although the sedentary minutes are too high. This means users can reduce their sedentary minutes and a scope of increasing the steps taken per day.\n",
    "\n",
    "3. Between the steps taken and calories burned, we can see a positive correlation, which can help motivate the users to take more steps to stay healthy.\n",
    "\n",
    "4. Another observation is that the users are more active at the start and the end of the week, but a little less active in the midweek.\n",
    "\n",
    "5. Also, the sleep time is more on weekends, mostly due to week offs in general for everyone.\n",
    "\n",
    "6. Although one more observation is that the steps taken in a day are majorly from 11:00 to 14:00 hrs and 17:00 to 19:00 hrs. This opens up a scope for taking more steps, otherwise lesser than the standard set by CCD of 10000 steps/ day.\n",
    "\n",
    "7. Among the active user, 78% use their devices all the time, while 9% use moderately and 3% use the least.\n"
   ]
